import axios from "axios";
import React from "react";
import { useParams } from "react-router-dom";

const Ordered = () => {
  const [order, setOrder] = React.useState({});
  const { id } = useParams();

  React.useEffect(() => {
    axios
      .get(`/orders/${id}`)
      .then((res) => {
        console.log(res.data);
        setOrder(res.data);
      })
      .catch((e) => {
        console.log(e);
        setError(e);
      });
  }, [id]);

  return (
    <div className="container">
      <form
        onSubmit={(e = onSubmit(e))}
        className="payme card"
        style={{
          maxWidth: "700px",
          margin: "50px auto",
          padding: "30px",
        }}
      >
        <img
          src="https://cdn.paycom.uz/documentation_assets/power-by-Payme.svg"
          alt="payme"
          style={{ height: "80px", margin: "0 auto" }}
        />
        <div class="row">
          <div class="input-field col s12">
            <input value="" id="number" type="number" class="validate" />
            <label htmlFor="number">Введите сумму (мин. 1000)</label>
          </div>
        </div>
        <div className="actions">
          <button type="submit" className="btn mr-1">
            Оплатить
          </button>
          <button className="btn">Отменить</button>
        </div>
      </form>
    </div>
  );
};

export default Ordered;
